import React, { Component } from 'react';

class Giftrip extends Component {
    render() {
        return (
            <div>
                <h2>Giftrip은 각 행사의 스팟에 가서 NFC를 찍고 스탬프를 받으며 마지막에는 경품을 얻을 수 있는 서비스 입니다.</h2>
            </div>
        );
    }
}

export default Giftrip;
